import { ArrowBackOutlined } from "@material-ui/icons"
import "./watch.scss"

export default function Watch() {
  return (
    <div className="wathc">
        <div className="back">
            <ArrowBackOutlined/>
            Home
        </div> 
        <video className="video" autoPlay progress controls src={require("../../assets/lofi-video.m4v")}/> 
    </div>
  )
}
